import React from 'react';
import { Link } from 'react-router-dom';
import { Form, FormControl, Button } from 'react-bootstrap';
import './Cart';
import Login from './Login';
import Homepage from '../Pages/Pizzaspage';
import Cart from './Cart';
import MainPage from '../Pages/MainPage';
import Registration from '../Sellermenu/RegistrationMenu';
import BiryanisPage from '../Pages/BiryanisPage';
import Signin from './Signin';
import Tiffinspage from '../Pages/Tiffinspage';
import NonVegSoupsPage from '../Pages/NonVegSoupsPage';
import VegSoupsPage from '../Pages/VegSoupsPage';
import Vegcurrys from '../Pages/vegcurryspage';
import Nonvegcurrys from '../Pages/nonvegcurryspage'
import Shakes from '../Pages/Shakespage'
import Cakes from '../Pages/Cakespage'

import CustomerProfile from './CustomerProfile';
export default function NavBar(props) {
  const [searchTerm, setSearchTerm] = useState('');

  const handleSearch = (e) => {
    e.preventDefault();
    // Perform search logic here, e.g., navigate to search results page
    console.log(searchTerm);
  };

  return (
    <div>
      <nav className="navbar navbar-expand-lg shadow-lg p-3 mb-5 bg-white rounded">
        <Link to="/" className="navbar-brand" style={{ fontSize: '50px' }}>
          FeastExpress
        </Link>
        <button
          className="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#navbarNav"
          aria-controls="navbarNav"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse justify-content-between" id="navbarNav">
          <ul className="navbar-nav">
            <li className="nav-item">
              <Link to="/" className="nav-link" style={{ fontSize: '30px' }}>
                Home
              </Link>
            </li>
            <li className="nav-item">
              <Link to="/offers" className="nav-link" style={{ fontSize: '30px' }}>
                offers
              </Link>
            </li>
            <li className="nav-item">
              <Link to="/cart" className="nav-link" style={{ fontSize: '30px' }}>
                Cart
              </Link>
            </li>
            <li className="nav-item">
              <Link to="/login" className="nav-link" style={{ fontSize: '30px' }}>
                Login
              </Link>
            </li>
            <li className="nav-item">
              <Link to="/signin" className="nav-link" style={{ fontSize: '30px' }}>
              Sign up
              </Link>
            </li>
            <li className="nav-item">
              <Link to="/CustomerProfile" className="nav-link" style={{ fontSize: '30px' }}>
                profile
              </Link>
            </li>
          </ul>
          <Form inline onSubmit={handleSearch}>
            <FormControl
              type="text"
              placeholder="Search"
              className="mr-sm-2"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
            />
            <Button variant="outline-success" type="submit">
              Search
            </Button>
          </Form>
          <Button variant="outline-primary" onClick={props.onCustomerLogin}>Login as Customer</Button>
          <Button variant="outline-primary" onClick={props.onSellerLogin}>Login as Seller</Button>
          <Button variant="outline-primary" onClick={props.onAdminLogin}>Login as Admin</Button>
        </div>
      </nav>
      <MainPage />
    </div>
  );
}
